import * as React from 'react';
import { View, Text, StyleSheet, Platform, TouchableOpacity, TextInput, StatusBar } from 'react-native';
import { ScrollView } from 'react-native-gesture-handler';
import { color } from 'react-native-reanimated';
import { SafeAreaProvider, SafeAreaView } from 'react-native-safe-area-context';
// import Feather from 'react-native-vector-icons/Feather';
// import LinearGradient from 'react-native-linear-gradient';
// import * as Animatable from 'react-native-animatable';
// import { AuthContext } from '../appContextFolder/Context';
// import { useTheme } from 'react-native-paper';

const Login = () => {
    return (
        <SafeAreaProvider style={{paddingHorizontal : 20, flex: 1, backgroundColor: '#f2f2f2'}}>
            <ScrollView showVerticalScrollIndicator={false}>
                <View style={{flexDirection: "row", marginTop: 40}}>
                    <Text style={{fontWeight: "bold", fontSize: 22, color: '#000'}}>JET</Text>
                    <Text>SPEED</Text>
                </View>
            </ScrollView>
        </SafeAreaProvider>
    );
}

export default Login;
